import { ChoseQuestionTypePopup } from 'modules/ChoseQuestionTypePopup/ChoseQuestionTypePopup';
import { AddClassPopup } from 'modules/AddClassPopup/AddClassPopup';

export const Popups = (props) => {

    return (
        <>
            <ChosePopup />
            <SigninPopup  />
            <SignupPopup />
            <ChoseQuestionTypePopup />
            <AddClassPopup />
        </>
 );
}
